import Button from "@mui/material/Button";
import "../Style/App.css";


import { createTheme } from '@mui/material/styles';

const theme = createTheme({
  palette: {
    primary: {
      light: '#757ce8',
      main: '#3f50b5',
      dark: '#002884',
      contrastText: '#fff',
    },
    secondary: {
      light: '#ff7961',
      main: '#f44336',
      dark: '#ba000d',
      contrastText: '#000',
    },
  },
});
export default function App() {
    return (
        <div className="Resource" >
<ThemeProvider theme={theme}>
  <CustomCheckbox defaultChecked />
</ThemeProvider>
            <Button
                variant="contained"
                color="primary"
                style={{ marginRight: "10px" }}
            >
                Contained
            </Button>
            <Button
                variant="contained"
                color="secondary"
                style={{ marginRight: "10px" }}
            >
                Contained
            </Button>
            <Button
                variant="contained"

            >
                Contained
            </Button>


        </div>
    );
}
